import React from 'react';

const Cart = ({ cartItems }) => {
  const getTotalPrice = () => {
    return cartItems.reduce((total, item) => total + item.price, 0);
  };

  return (
    <div>
      <h2>Carrito</h2>
      {cartItems.map(item => (
        <div key={item.id}>
          <h3>{item.title}</h3>
          <p>{item.price}$</p>
          <hr />
        </div>
      ))}
      <h3>Total: {getTotalPrice()}$</h3>
    </div>
  );
};

export default Cart;
